import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import logo from '../Images/logo.png';

const Navbar = ({ onDropdownToggle }) => {
  const [showDropdown, setShowDropdown] = useState(false);
  const navigate = useNavigate();

  // Animation variants
  const dropdownVariants = {
    hidden: {
      opacity: 0,
      y: -10,
      scale: 0.95,
      transition: {
        duration: 0.2,
        ease: "easeOut"
      }
    },
    visible: {
      opacity: 1,
      y: 0,
      scale: 1,
      transition: {
        duration: 0.3,
        ease: "easeOut",
        staggerChildren: 0.05
      }
    },
    exit: {
      opacity: 0,
      y: -10,
      scale: 0.95,
      transition: {
        duration: 0.2,
        ease: "easeIn"
      }
    }
  };

  const itemVariants = {
    hidden: {
      opacity: 0,
      x: -10,
      transition: { duration: 0.2 }
    },
    visible: {
      opacity: 1,
      x: 0,
      transition: { duration: 0.3, ease: "easeOut" }
    }
  };

  const buttonVariants = {
    hover: {
      scale: 1.05,
      transition: { duration: 0.2 }
    },
    tap: {
      scale: 0.95,
      transition: { duration: 0.1 }
    }
  };

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      const navbarHeight = 80;
      const elementPosition = element.offsetTop - navbarHeight;
      window.scrollTo({
        top: elementPosition,
        behavior: 'smooth'
      });
    }
  };

  return (
    <nav style={{ 
      position: 'fixed', 
      top: '10px', 
      width: '100%', 
      backgroundColor: 'transparent', 
      zIndex: 9999,
      pointerEvents: 'auto'
    }}>
      <div style={{ 
        maxWidth: '1200px', 
        margin: '0 auto', 
        padding: '0 16px',
        display: 'flex',
        alignItems: 'center',
        height: '64px'
      }}>
        <div style={{ flex: '0 0 auto' }}>
          <img 
            src={logo} 
            alt="MOE" 
            style={{ height: '48px', width: 'auto', cursor: 'pointer' }}
            onClick={() => window.scrollTo({ top: 0, behavior: 'smooth' })}
          />
        </div>

        <div style={{ 
          flex: '1',
          display: 'flex', 
          justifyContent: 'center',
          alignItems: 'center', 
          gap: '32px' 
        }}>
          <motion.button
            variants={buttonVariants}
            whileHover="hover"
            whileTap="tap"
            onClick={() => window.location.href = '/'}
            style={{
              background: 'none',
              border: 'none',
              color: 'white',
              fontSize: '14px',
              fontWeight: '500',
              cursor: 'pointer',
              padding: '12px 16px',
              userSelect: 'none',
              borderRadius: '4px',
              transition: 'color 0.2s ease'
            }}
            onMouseEnter={(e) => e.target.style.color = '#9ca3af'}
            onMouseLeave={(e) => e.target.style.color = 'white'}
          >
            HOME
          </motion.button>

          <div style={{ position: 'relative' }}>
            <motion.button
              variants={buttonVariants}
              whileHover="hover"
              whileTap="tap"
              onClick={() => {
                const newState = !showDropdown;
                setShowDropdown(newState);
                if (onDropdownToggle) onDropdownToggle(newState);
              }}
              style={{
                background: 'none',
                border: 'none',
                color: 'white',
                fontSize: '14px',
                fontWeight: '500',
                cursor: 'pointer',
                padding: '12px 16px',
                userSelect: 'none',
                borderRadius: '4px',
                transition: 'color 0.2s ease'
              }}
              onMouseEnter={(e) => e.target.style.color = '#9ca3af'}
              onMouseLeave={(e) => e.target.style.color = 'white'}
            >
              PROJECTS
            </motion.button>

            <AnimatePresence>
              {showDropdown && (
                <motion.div
                  variants={dropdownVariants}
                  initial="hidden"
                  animate="visible"
                  exit="exit"
                  style={{
                    position: 'absolute',
                    top: '100%',
                    left: '0',
                    backgroundColor: 'rgba(0, 0, 0, 0.8)',
                    backdropFilter: 'blur(10px)',
                    borderRadius: '8px',
                    padding: '8px 0',
                    minWidth: '180px',
                    marginTop: '8px',
                    zIndex: 1001,
                    border: '1px solid rgba(255, 255, 255, 0.1)'
                  }}
                >
                  <motion.button
                    variants={itemVariants}
                    onClick={() => {
                      setShowDropdown(false);
                      scrollToSection('residential');
                    }}
                    style={{
                      width: '100%',
                      background: 'none',
                      border: 'none',
                      padding: '12px 16px',
                      textAlign: 'left',
                      cursor: 'pointer',
                      fontSize: '14px',
                      fontWeight: '500',
                      textTransform: 'uppercase',
                      letterSpacing: '1px',
                      color: 'white',
                      marginBottom: '8px',
                      borderRadius: '4px',
                      transition: 'all 0.2s ease'
                    }}
                    whileHover={{
                      backgroundColor: 'rgba(255, 255, 255, 0.1)',
                      color: '#9ca3af',
                      scale: 1.02
                    }}
                    whileTap={{
                      scale: 0.98,
                      backgroundColor: 'rgba(255, 255, 255, 0.2)'
                    }}
                  >
                    RESIDENTIAL
                  </motion.button>
                  <motion.button
                    variants={itemVariants}
                    onClick={() => {
                      setShowDropdown(false);
                      scrollToSection('commercial');
                    }}
                    style={{
                      width: '100%',
                      background: 'none',
                      border: 'none',
                      padding: '12px 16px',
                      textAlign: 'left',
                      cursor: 'pointer',
                      fontSize: '14px',
                      fontWeight: '500',
                      textTransform: 'uppercase',
                      letterSpacing: '1px',
                      color: 'white',
                      marginBottom: '8px',
                      borderRadius: '4px',
                      transition: 'all 0.2s ease'
                    }}
                    whileHover={{
                      backgroundColor: 'rgba(255, 255, 255, 0.1)',
                      color: '#9ca3af',
                      scale: 1.02
                    }}
                    whileTap={{
                      scale: 0.98,
                      backgroundColor: 'rgba(255, 255, 255, 0.2)'
                    }}
                  >
                    COMMERCIAL
                  </motion.button>
                  <motion.button
                    variants={itemVariants}
                    onClick={() => {
                      setShowDropdown(false);
                      scrollToSection('school');
                    }}
                    style={{
                      width: '100%',
                      background: 'none',
                      border: 'none',
                      padding: '12px 16px',
                      textAlign: 'left',
                      cursor: 'pointer',
                      fontSize: '14px',
                      fontWeight: '500',
                      textTransform: 'uppercase',
                      letterSpacing: '1px',
                      color: 'white',
                      marginBottom: '8px',
                      borderRadius: '4px',
                      transition: 'all 0.2s ease'
                    }}
                    whileHover={{
                      backgroundColor: 'rgba(255, 255, 255, 0.1)',
                      color: '#9ca3af',
                      scale: 1.02
                    }}
                    whileTap={{
                      scale: 0.98,
                      backgroundColor: 'rgba(255, 255, 255, 0.2)'
                    }}
                  >
                    SCHOOL
                  </motion.button>
                  <motion.button
                    variants={itemVariants}
                    onClick={() => {
                      setShowDropdown(false);
                      scrollToSection('interior');
                    }}
                    style={{
                      width: '100%',
                      background: 'none',
                      border: 'none',
                      padding: '12px 16px',
                      textAlign: 'left',
                      cursor: 'pointer',
                      fontSize: '14px',
                      fontWeight: '500',
                      textTransform: 'uppercase',
                      letterSpacing: '1px',
                      color: 'white',
                      borderRadius: '4px',
                      transition: 'all 0.2s ease'
                    }}
                    whileHover={{
                      backgroundColor: 'rgba(255, 255, 255, 0.1)',
                      color: '#9ca3af',
                      scale: 1.02
                    }}
                    whileTap={{
                      scale: 0.98,
                      backgroundColor: 'rgba(255, 255, 255, 0.2)'
                    }}
                  >
                    INTERIOR
                  </motion.button>
                </motion.div>
              )}
            </AnimatePresence>
          </div>

          <motion.button
            variants={buttonVariants}
            whileHover="hover"
            whileTap="tap"
            onClick={() => scrollToSection('about')}
            style={{
              background: 'none',
              border: 'none',
              color: 'white',
              fontSize: '14px',
              fontWeight: '500',
              cursor: 'pointer',
              padding: '12px 16px',
              userSelect: 'none',
              borderRadius: '4px',
              transition: 'color 0.2s ease'
            }}
            onMouseEnter={(e) => e.target.style.color = '#9ca3af'}
            onMouseLeave={(e) => e.target.style.color = 'white'}
          >
            ABOUT
          </motion.button>

          <motion.button
            variants={buttonVariants}
            whileHover="hover"
            whileTap="tap"
            onClick={() => scrollToSection('contact')}
            style={{
              background: 'none',
              border: 'none',
              color: 'white',
              fontSize: '14px',
              fontWeight: '500',
              cursor: 'pointer',
              padding: '12px 16px',
              userSelect: 'none',
              borderRadius: '4px',
              transition: 'color 0.2s ease'
            }}
            onMouseEnter={(e) => e.target.style.color = '#9ca3af'}
            onMouseLeave={(e) => e.target.style.color = 'white'}
          >
            CONTACT
          </motion.button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
